      <div>
        <label htmlFor="">Height</label>
        <input type="text" />
      </div>
      <button>Change</button>
      <div
        style={{
          boxSizing: "border-box",
          width: 200,
          height: 200,
        }}
      ></div>
    </>
  );
}

export default ChangeBorder;
